import './App.css';

function App() {
  return (
    <div class="center">
      <button class="header_button_login">LOGIN</button>
      <button class="header_button_signup">SIGNUP</button>
      <p>User Name</p>
      <input type="text" placeholder='username'></input>
      <p>Password</p>
      <input type="password" placeholder='password'></input>
      <br />
      <br />
      <button type="submit">Login</button>
    </div>
  );
}

export default App;
